"""`Объект (экземпляр класса)` – это сущность, предмет или явление (процесс), имеющий чётко выраженные границы, индивидуальность и поведение. Создаётся на основе класса и выполняет инструкции, описанные в классе.

Объекты класса можно создавать в неограниченном количестве.


`Конструктор` - место, где инициализируются динамические атрибуты класса


`Методы` - функции, только они находятся в классе и используются для объектов

Основное отличие функций от методов в том, что методы в классах - динамические.

`self` – ключевое слово, которое является ссылкой на объект и используется для
вызова методов и атрибутов определённого объекта в классе. Такая ссылка
передаётся вместе со всеми аргументами, т.к. понимает, к какому объекту вы
обращаетесь.
"""

# реализация своего типа данных "кубик"
import random

