"""# **Свойства класса:**

`Свойства (атрибуты класса)` – это все переменные в классе, которые могут
использовать объекты


`Статические свойства` – объявляются в классе и на протяжении всего класса
являются одинаковым значением

`Динамические свойства` – задают начальное состояние определённому объекту и
меняются у каждого объекта при выполнении какого-либо действия с
ним

Все динамические свойства инициализируется в конструкторе класса и
являются начальным состоянием объекта.

# **Методы класса:**

`Методы классов` - это функции, определенные внутри класса, которые могут выполнять определенные операции с атрибутами (переменными) класса. Они предоставляют возможность обработки данных объектов класса и определения их поведения.



В Python существуют три типа методов классов:

1. Методы экземпляра (instance methods):

* Они принимают в качестве первого параметра ссылку на экземпляр класса (self).
* Используются для работы с атрибутами экземпляра класса.
* Могут изменять состояние объекта, получать доступ к его атрибутам и вызывать другие методы.
* Часто используются для реализации операций, специфичных для каждого экземпляра класса.
"""

class MyClass:
    def __init__(self, name):
        self.name = name

    def say_hello(self):
        print("Привет, меня зовут", self.name)

obj = MyClass("Антонина Зигизмундовна")
obj.say_hello()  # Привет, меня зовут Антонина Зигизмундовна

"""2. Статические методы (static methods):

* Они не принимают ссылку на экземпляр класса (self) в качестве первого параметра.
* Они могут выполняться без создания экземпляра класса.
* Используются для выполнения операций, не зависящих от состояния объекта или экземпляра класса.
* Могут быть полезными, когда нам нужно группировать операции, связанные с классом, внутри класса.
"""

class MathUtils:
    @staticmethod
    def add_numbers(x, y):
        return x + y

result = MathUtils.add_numbers(5, 3)
print(result)  # 8

"""3. Методы класса (class methods):

* Они принимают ссылку на класс (cls) в качестве первого параметра.
* Они имеют доступ к атрибутам класса, но не имеют доступа к атрибутам экземпляров класса.
* Могут использоваться для выполнения операций, связанных с классом в целом, а не с конкретным экземпляром класса.
"""

class Circle:
    pi = 3.14159

    def __init__(self, radius):
        self.radius = radius

    @classmethod
    def from_diameter(cls, diameter):
        radius = diameter / 2
        return cls(radius)

    def calculate_area(self):
        return self.pi * (self.radius ** 2)

circle = Circle.from_diameter(10)
print(circle.calculate_area())  # 78.53975

circle_2 = Circle(5)
print(circle_2.calculate_area())

"""**Методы** - поведение нашего объекта (то, как и что он может делать)

**Атрибуты** - состояние нашего объекта (то, какие изначально параметры у нашего объекта)
"""

class User:

  def __init__(self, user_name):
    self.name = user_name
    self.messages = []

  def send_message(self, target):
    message = input("Enter your message: ")
    target.get_message(message)

  def get_message(self, message):
    self.messages.append(message)
    print(f"User '{self.name}' got message")

  def check_mail(self):
    for message in self.messages:
      print(message)

nick = User("Nick")
mike = User("Mike")

nick.send_message(mike)

mike.check_mail()

mike.name

mike.send_message(nick)

import random
import cowsay

# 🍗☠️❤️😵

class Tamagochi:
    _mood = {
        range(10): "😄",
        range(10, 20): "😊",
        range(20, 30): "😏",
        range(30, 40): "🙂",
        range(40, 50): "😐",
        range(50, 60): "🫤",
        range(60, 70): "😕",
        range(70, 80): "😣",
        range(80, 90): "😠",
        range(90, 99): "🥵",
        range(99, 200): "🤬",
    }

    def __init__(self, name) -> None:
       self._name = name
       self._hungry = 1
       self._stress = 0
       self._health = 5
       self._isdead = False


    def _check_status(self):
        if self._hungry < 0 or self._health <= 0:
            self._isdead = True
            cowsay.kitty("I'm dead............")
        elif self._stress >= random.randint(75, 100):
            self._health -= random.randint(0, 2)
            self._stress -= random.randint(5, 30)


    def play(self):
        if self._isdead:
            print(f"{self._name} is dead!!!!!!!")
            return

        self._stress = abs(self._stress - random.randint(1, 10))
        self._hungry -= random.randint(0, 2)
        self._check_status()


    def feed(self):
        if self._isdead:
            print(f"{self._name} is dead!!!!!!!")
            return
        self._stress += random.randint(1, 30)
        if self._hungry >= 5:
            print("\n\n")
            cowsay.kitty("I'm not hungry")
        else:
            self._stress += random.randint(1, 30)
            self._hungry += 1
        self._check_status()


    def _stress_graphic(self):
        if self._isdead:
            return "☠️"
        for r, m in self._mood.items():
            if self._stress in r:
                return m


    def __repr__(self) -> str:
       return f"""
       ===========================
       name: {self._name} {"😵" if self._isdead else ""}
       health: {"❤️" * self._health if self._health >= 1 else "☠️"}
       stress: {self._stress_graphic()}
       hungry: {"🍗" * self._hungry if self._hungry >= 1 else "☠️"}
       ===========================
       """

tamagotchi = Tamagochi("Fluffy")

tamagotchi

tamagotchi.play()

tamagotchi.feed()

